import React from "react";

import SearchText from "../components/Search/SearchText"
import SearchBox from "../components/Search/SearchBox"

export default class Search extends React.Component {
    render() {
        return(
            <div>
                <SearchText/>
                <SearchBox/>
            </div>
        )
    }
}
